import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  fetch('http://localhost:4000/api/v1/moves/').catch((err) => {console.log(err);});

  return (
    <>
      <div className="pieceDisplay" id="WhiteDisplay"></div>
      <div id="GameBoard" className="GameBoard"></div>
      <div className="pieceDisplay" id="BlackDisplay"></div>
    </>
  );
}

export default App;
